    [],nt"num_tags": 31,nt"name": "prime-hook-national-wildlife-refuge-annual-narrative-report-calendar-year-1995",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Prime
    Hook National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, manpower programs, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, fire management, and pest control. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
    resources, and marking and banding. There is a section with detailed statistics
    on the refuge White-tailed Deer herd, including management implications and recommendations.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, computer systems, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Refuge brochures and field guides
    are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
